import Pay from "./Pay"
import Success from "./Success"
import React from "react"
import { BrowserRouter,Route ,Router, Switch } from "react-router-dom";

const App = () => {

    return (
        <BrowserRouter>
            <Switch>
                <Route path="/pay" element={<Pay/>} />
                
                <Route path="/success" component={<Success/>}/>
            
            </Switch>
        </BrowserRouter>
    );
};

export default App;
